import React, { useState } from 'react';
import '../../App.css';
import { Button } from '../Button';
import './MonitorList.css';
import MonitorRow from './MonitorRow';

function Monitor() {

    const students = [{
        profilePic: '/images/jingyuan.webp',
        name: 'Johnny',
        studentId: '1800795',
        course: 'Software Engineering',
        trimester: 'Y5S2',
        attendance: '83',
        mentalHealth: '63',
        address: '/profile',
        appt: '01/02/2023',
        lastTested: '02/03/2022'
    }]

    const monitorRowDisplay = () => {
        const row = [];
        for (let i = 0; i < students.length; i++) {
            row.push(
                <MonitorRow
                    isOpen='true'
                    profilePic={students[i].profilePic}
                    name={students[i].name}
                    studentId={students[i].studentId}
                    course={students[i].course}
                    trimester={students[i].trimester}
                    attendance={students[i].attendance}
                    mentalHealth={students[i].mentalHealth}
                    address={students[i].address}
                    appt={students[i].appt}
                    lastTested={students[i].lastTested}
                />
            )
        }
        return row
    }

    return (
        <div class="contentContainer">
            <h1 className="monitorTitle">Monitor List</h1>
            <div className="searchBarMonitor">Enter here...</div>
{monitorRowDisplay()}
        </div>
    );
}

export default Monitor;
